type TitleBannerViewProps = {
  title: string;
  body?: string;
}

const TitleBannerView = ({ title, body }: TitleBannerViewProps) => (
  <header className='c-image-banner'>
    <div className='c-image-banner__container'>
      <img />
    </div>
  </header>
)

export default TitleBannerView
